特長<br>

■アルミホイール対応薄型ソケット(材質：クロムバナジウム鋼)５サイズ付属<br>
■握りやすいラバーグリップ<br>
■設定数値が見やすいウィンドウ表示<br>
■設定値のずれを防止する設定値ロック機構付<br>
■収納に便利なブローケース付<br><br>

製品仕様<br>
トルク測定範囲：42～210N・m <br>
形式：ラチェット形　プレセット式 <br>
角ドライブ：□12.7mm <br>
精度：±4％ <br>
全長：515mm <br>
質量：1.28kg <br>
本体サイズ：41.5(W)×515(L)×41(H)mm <br>
トルク設定方向：右回転のみ <br>
付属品：<br>
アルミホイール対応 薄型ソケット(14・17・19・21・23mm)<br>
エクステンションバー125mm<br>
