【ヴォクシー80　ノア80 エスクァイア OBD2 車速ドアロック】[80VOXY　80NOAH][80ヴォクシー][80ノア][エスクァイア][アクア][プリウス プリウスα][ヴィッツ] 
      ■【オートドアロック】<br>
      ─────────<br>
高級車に標準装備されている車速連動の自動ドアロックをお手軽に追加できる超便利アイテムです！<br>

お子様のいたずらなどで走行中のドアが開閉する心配も無くなるので安心！！<br>


時速15～20Ｋｍになるとオートドアロックがかかり、Pで自動ロック解除、衝撃感応のアンロック機能も搭載されております。<br>
※一部車種ではエンジンOFFでロック解除の場合等、Pレンジで解除されない車種もございます。<br> 
<br>
■【オートハザード】<br>
─────────<br>
高速パーキングエリア駐車時などにバック連動で自動でハザード点滅してくれる超便利アイテムです！ <br>
日中はバックランプの白色のみだと見えにくいですが、 <br>
ハザード点滅が加わると「これから駐車しますよ」と後続車に意思表示ができ、<br>
まわりの通行人にも注意を促しますので事故防止につながります。 <br><style type="text/css">
